import React, { Component } from "react";
import { Alert, Card, Table, Button } from 'tabler-react';

class Overview extends React.Component {
    render() {
        return (
            <div className="dashboard">
                <Table>
                    <Table.Header>
                        <Table.ColHeader>Type</Table.ColHeader>
                        <Table.ColHeader>Name</Table.ColHeader>
                        <Table.ColHeader>Value</Table.ColHeader>
                        <Table.ColHeader>Value in USD</Table.ColHeader>
                    </Table.Header>
                    <Table.Body>
                        <Table.Row>
                            <Table.Col><Icon name="user"/></Table.Col>
                            <Table.Col>Main Wallet</Table.Col>
                            <Table.Col>0.0064</Table.Col>
                            <Table.Col>123$</Table.Col>
                        </Table.Row>
                    </Table.Body>
                </Table>
            </div>
        )
    }
}

export default Overview;
